cy.get('.thumbnail').find('.oneprice').invoke('text').as('itemPrice');
cy.get('.thumbnail').find('.pricenew').invoke('text').as('saleItemPrice');
var itemsTotal = 0; // Non sale price total
cy.get('@itemPrice').then(function ($linkText) {
  var itemPriceTotal = 0;
  var itemPrice = $linkText.split('$');
  for (var i = 0; i < itemPrice.length; i++) {
    itemPriceTotal += Number(itemPrice[i]);
  }
  itemsTotal += itemPriceTotal;
  cy.log('Non sale price items total: ' + itemPriceTotal);
}); // Sale price total
cy.get('@saleItemPrice').then(function ($linkText) {
  var saleItemPriceTotal = 0;
  var saleItemPrice = $linkText.split('$');
  for (var i = 0; i < saleItemPrice.length; i++) {
    saleItemPriceTotal += Number(saleItemPrice[i]);
  }
  itemsTotal += saleItemPriceTotal;
  cy.log('Sale price items total: ' + saleItemPriceTotal);
}).then(function () {
  cy.log("The total price of all products: ".concat(itemsTotal));
  expect(itemsTotal).to.equal(654.1);
});

