var userDetails = []; // tworzenie tablicy
var totalAgeNumber = 0; // zmienna z sumą wieku
cy.get('#thumbnail-1 td').each(function ($el, index, $list) {
  userDetails[index] = $el.text(); // pobieranie tekst każdego elementu z selektora
}).then(function () {
  for (var i = 0; i < userDetails.length; i++) {
    // sprawdzanie pętlą elementów z tablicy
    if (Number(userDetails[i])) {
      // jeśli element jest liczbą, aktualizowana jest zmienna totalAgeNumber
      totalAgeNumber += Number(userDetails[i]);
    } //cy.log(userDetails[i])
  }
  cy.log("Found total age: " + totalAgeNumber);
  expect(totalAgeNumber).to.eq(322);
});

cy.get('#thumbnail-1 tr td:nth-child(2)').each(function ($el, index, $list) {
  var text = $el.text();
  if (text.includes('Woods')) {
    cy.get('#thumbnail-1 tr td:nth-child(2)').eq(index).next().then(function (age) {
      // next przeniesie do komórki obok (w prawo) w tabeli
      var userAge = age.text();
      expect(userAge).to.eq('80');
    });
  }
});

