cy.get('#datepicker').invoke('removeAttr', 'target').click({
  force: true
}); // workaround to do not open a new tab
cy.get('#datepicker').click(); // let date = new Date();
// date.setDate(date.getDate()) // get current date
// cy.log(date.getDate())
// let date1 = new Date();
// date1.setDate(date1.getDate() + 5)
// cy.log(date1.getDate())
var date = new Date();
date.setDate(date.getDate() + 30); // mozemy zmieniac dni do przodu lub do tyłu
var futureYear = date.getFullYear();
var futureMonth = date.toLocaleString("en-Us", {
  month: "long"
});
var futureDay = date.getDate();
cy.log(futureYear);
cy.log(futureMonth);
cy.log(futureDay);
function selectMonthAndYear() {
  cy.get('.datepicker-dropdown').find('.datepicker-switch').first().then(function (currentDate) {
    if (!currentDate.text().includes(futureYear)) {
      cy.get('.next').first().click();
      selectMonthAndYear();
    }
  }).then(function () {
    cy.get('.datepicker-dropdown').find('.datepicker-switch').first().then(function (currentDate) {
      if (!currentDate.text().includes(futureMonth)) {
        cy.get('.next').first().click();
        selectMonthAndYear();
      }
    });
  });
}
function selectFutureDay() {
  cy.get('[class="day"').contains(futureDay).click();
}
selectMonthAndYear();
selectFutureDay();

